import Layout from '../components/Layout';

const random: React.FC = () => {
  return (
    <Layout style={{ height: '100vh' }}>
      <div className="fullscreen">
        <h1 className="title">#FFFFFF</h1>
      </div>
    </Layout>
  );
};

export default random;
